function AboutMe() {
  return (
    <div className="bg-lightTone font-racing text-darkTone p-8">
      <div className="max-w-96">
        I'm a recent Computer Science graduate from Carleton University, based
        in Ottawa, ON. I am keen to transition my academic knowledge into
        practical applications. Actively seeking roles in frontend, backend, and
        full-stack development, I aspire to join a team where innovation,
        collaboration, and making a tangible impact through technology are at
        the forefront. I'm excited about the opportunity to grow as a developer
        and contribute my skills to create meaningful projects.
      </div>
    </div>
  );
}

export default AboutMe;
